import { useState, useEffect } from 'react';
import './App.css';

function VideoArray() {
  const [data, setData] = useState(null);
  const [arr, setArr] = useState(null);


  useEffect(() => {
    fetch("/videos")
      .then((res) => res.json())
      .then((data) => setData(data.array))
  }, []);

  console.log(data);

  if (data) {
    console.log("data retrieved");
    data.forEach(element => {
      array.push("<tr><input type='text'>" + element + "</div>");
    });
  }

  return (
      <div>{!data ? "Loading..." : data[0]}</div>
  );
}

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    // fetch with parameters is working yay... find a way to use this to get a specific file in a folder, also utilizing serve-index
    fetch("/api/123")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
     <p>{!data ? "Loading..." : data}</p>
     <VideoArray />
    </div>
  );
}

export default App;
